import React, { useState } from 'react';
import { BurstPair, LeadLag, PMIResult } from '../types/insights';
import { TrendingUp, Zap, GitBranch, Filter } from 'lucide-react';

interface CorrelationsPanelProps {
  burstPairs: BurstPair[];
  leadLag: LeadLag[];
  pmi: PMIResult[];
}

const CorrelationsPanel: React.FC<CorrelationsPanelProps> = ({ burstPairs, leadLag, pmi }) => {
  const [activeSubTab, setActiveSubTab] = useState<'burst' | 'leadlag' | 'pmi'>('burst');
  const [serviceFilter, setServiceFilter] = useState<string>('all');
  const [levelFilter, setLevelFilter] = useState<string>('all');

  // Extract unique services and levels for filtering
  const getUniqueServices = () => {
    const services = new Set<string>();
    [...burstPairs, ...leadLag].forEach(item => {
      if ('series1' in item && 'series2' in item) {
        [item.series1, item.series2].forEach(series => {
          const parts = series.split('|');
          if (parts.length > 0) services.add(parts[0]);
        });
      }
    });
    return Array.from(services);
  };

  const getUniqueLevels = () => {
    const levels = new Set<string>();
    [...burstPairs, ...leadLag].forEach(item => {
      if ('series1' in item && 'series2' in item) {
        [item.series1, item.series2].forEach(series => {
          const parts = series.split('|');
          if (parts.length > 1) levels.add(parts[1]);
        });
      }
    });
    return Array.from(levels);
  };

  const filterCorrelations = <T extends BurstPair | LeadLag>(correlations: T[]): T[] => {
    return correlations.filter(item => {
      if (serviceFilter === 'all' && levelFilter === 'all') return true;

      const series = [item.series1, item.series2];
      const serviceMatch = serviceFilter === 'all' || series.some(s => s.includes(serviceFilter));
      const levelMatch = levelFilter === 'all' || series.some(s => s.includes(levelFilter));

      return serviceMatch && levelMatch;
    });
  };

  const formatCorrelation = (value: number) => {
    return value.toFixed(3);
  };

  const formatPValue = (value: number) => {
    return value < 0.001 ? '<0.001' : value.toFixed(3);
  };

  const getSignificanceColor = (isSignificant: boolean) => {
    return isSignificant ? 'text-green-600' : 'text-gray-600';
  };

  const renderBurstPairs = () => {
    const filtered = filterCorrelations(burstPairs);

    return (
      <div className="space-y-4">
        <div className="overflow-x-auto">
          <table className="table">
            <thead>
              <tr>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Series Pair
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Correlation
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  P-value
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Aligned Bursts
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Strength
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Significant
                </th>
              </tr>
            </thead>
            <tbody>
              {filtered.map((pair, index) => (
                <tr key={index} className="hover:bg-gray-50 transition-colors">
                  <td className="px-6 py-4">
                    <div className="flex items-center space-x-3">
                      <div className="w-8 h-8 bg-blue-100 rounded-lg flex items-center justify-center">
                        <Zap className="h-4 w-4 text-blue-600" />
                      </div>
                      <div className="min-w-0 flex-1">
                        <div className="text-sm font-medium text-gray-900 truncate">{pair.series1}</div>
                        <div className="text-xs text-gray-500">↔ {pair.series2}</div>
                      </div>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm font-semibold text-gray-900">
                      {formatCorrelation(pair.correlation)}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm text-gray-900">
                      {formatPValue(pair.p_value)}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="text-sm text-gray-900">
                      {pair.aligned_bursts} / {pair.total_buckets}
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="flex items-center">
                      <div className="w-16 bg-gray-200 rounded-full h-2 mr-2">
                        <div 
                          className="bg-blue-600 h-2 rounded-full" 
                          style={{ width: `${pair.alignment_strength * 100}%` }}
                        ></div>
                      </div>
                      <span className="text-sm text-gray-900">
                        {(pair.alignment_strength * 100).toFixed(1)}%
                      </span>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`badge ${pair.is_significant ? 'badge-success' : 'badge-warning'}`}>
                      {pair.is_significant ? 'Yes' : 'No'}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {filtered.length === 0 && (
          <div className="text-center py-12">
            <div className="w-16 h-16 bg-gray-100 rounded-full flex items-center justify-center mx-auto mb-4">
              <Zap className="h-8 w-8 text-gray-400" />
            </div>
            <h3 className="text-lg font-medium text-gray-900 mb-2">No Burst Correlations</h3>
            <p className="text-gray-500">
              No burst correlations match the current filter criteria.
            </p>
          </div>
        )}
      </div>
    );
  };

  const renderLeadLag = () => {
    const filtered = filterCorrelations(leadLag);

    return (
      <div className="space-y-4">
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Series Pair
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Direction
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Lag
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Correlation
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Granger Score
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Confidence
                </th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {filtered.map((item, index) => (
                <tr key={index} className="hover:bg-gray-50">
                  <td className="px-6 py-4">
                    <div className="text-sm">
                      <div className="font-medium text-gray-900">{item.series1}</div>
                      <div className="text-gray-500">→ {item.series2}</div>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`inline-flex px-2 py-1 text-xs font-semibold rounded-full ${
                      item.direction === 'series1_leads' ? 'bg-blue-100 text-blue-800' :
                      item.direction === 'series2_leads' ? 'bg-green-100 text-green-800' :
                      'bg-gray-100 text-gray-800'
                    }`}>
                      {item.direction.replace('_', ' ')}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {item.lag_seconds}s
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {formatCorrelation(item.correlation)}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {item.granger_score.toFixed(3)}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {item.confidence.toFixed(3)}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {filtered.length === 0 && (
          <div className="text-center py-8 text-gray-500">
            No lead-lag relationships match the current filters.
          </div>
        )}
      </div>
    );
  };

  const renderPMI = () => {
    return (
      <div className="space-y-4">
        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Token Pair
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  PMI Score
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Support
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Confidence
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Error Token
                </th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {pmi.slice(0, 50).map((item, index) => (
                <tr key={index} className="hover:bg-gray-50">
                  <td className="px-6 py-4">
                    <div className="text-sm">
                      <div className="font-medium text-gray-900 truncate max-w-xs" title={item.token_a}>
                        {item.token_a}
                      </div>
                      <div className="text-gray-500 truncate max-w-xs" title={item.token_b}>
                        ↔ {item.token_b}
                      </div>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {item.pmi_score.toFixed(2)}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {item.support}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {item.confidence.toFixed(3)}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`text-sm font-medium ${item.has_error_token ? 'text-red-600' : 'text-gray-600'}`}>
                      {item.has_error_token ? 'Yes' : 'No'}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {pmi.length === 0 && (
          <div className="text-center py-8 text-gray-500">
            No PMI co-occurrences found.
          </div>
        )}
      </div>
    );
  };

  return (
    <div className="space-y-6">
      {/* Professional Filters */}
      <div className="bg-gray-50 rounded-xl p-6">
        <div className="flex items-center justify-between mb-4">
          <div className="flex items-center space-x-2">
            <Filter className="h-5 w-5 text-gray-600" />
            <h3 className="text-lg font-semibold text-gray-900">Filter Correlations</h3>
          </div>
          <div className="text-sm text-gray-500">
            Showing {activeSubTab === 'burst' ? burstPairs.length : activeSubTab === 'leadlag' ? leadLag.length : pmi.length} results
          </div>
        </div>
        <div className="flex flex-wrap gap-6">
          <div className="flex-1 min-w-48">
            <label className="block text-sm font-medium text-gray-700 mb-2">Service</label>
            <select
              value={serviceFilter}
              onChange={(e) => setServiceFilter(e.target.value)}
              className="input w-full"
            >
              <option value="all">All Services</option>
              {getUniqueServices().map(service => (
                <option key={service} value={service}>{service}</option>
              ))}
            </select>
          </div>

          <div className="flex-1 min-w-48">
            <label className="block text-sm font-medium text-gray-700 mb-2">Level</label>
            <select
              value={levelFilter}
              onChange={(e) => setLevelFilter(e.target.value)}
              className="input w-full"
            >
              <option value="all">All Levels</option>
              {getUniqueLevels().map(level => (
                <option key={level} value={level}>{level}</option>
              ))}
            </select>
          </div>
        </div>
      </div>

      {/* Professional Sub-tabs */}
      <div className="card">
        <div className="tab-nav">
          <button
            onClick={() => setActiveSubTab('burst')}
            className={`tab-button ${
              activeSubTab === 'burst' ? 'active' : ''
            }`}
          >
            <div className="flex items-center space-x-2">
              <Zap className="h-4 w-4" />
              <span>Burst Correlations</span>
              <span className="badge badge-primary">
                {burstPairs.length}
              </span>
            </div>
          </button>
          <button
            onClick={() => setActiveSubTab('leadlag')}
            className={`tab-button ${
              activeSubTab === 'leadlag' ? 'active' : ''
            }`}
          >
            <div className="flex items-center space-x-2">
              <TrendingUp className="h-4 w-4" />
              <span>Lead-Lag</span>
              <span className="badge badge-success">
                {leadLag.length}
              </span>
            </div>
          </button>
          <button
            onClick={() => setActiveSubTab('pmi')}
            className={`tab-button ${
              activeSubTab === 'pmi' ? 'active' : ''
            }`}
          >
            <div className="flex items-center space-x-2">
              <GitBranch className="h-4 w-4" />
              <span>PMI Co-occurrence</span>
              <span className="badge badge-warning">
                {pmi.length}
              </span>
            </div>
          </button>
        </div>

        <div className="p-6">
          {activeSubTab === 'burst' && (
            <div className="fade-in">
              {renderBurstPairs()}
            </div>
          )}
          {activeSubTab === 'leadlag' && (
            <div className="fade-in">
              {renderLeadLag()}
            </div>
          )}
          {activeSubTab === 'pmi' && (
            <div className="fade-in">
              {renderPMI()}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default CorrelationsPanel;
